import React from "react";
import Navbar from "../components/Navbar";

const background =
  "https://media.istockphoto.com/id/1356830579/photo/newly-striped-parking-lot.jpg?s=612x612&w=0&k=20&c=oJtKltmJGjsZ5SVllCVwm3cJzHQafcZmgbmbpWkH3tw=";

function Home() {
  return (
    <div>
      <Navbar></Navbar>
      <div>
        <form className="border-2 w-1/2 ">
            <label for="car_number"> Car Number :</label>
            <input id="car_number" type="text" name="car_number" />
            <label for="phone">Phone Number : </label>
            <input id="phone" type="tele" name="phone" />
        </form>
      </div>
    </div>
  );
}

export default Home;
